// And groups predicates with the AND operator between them.
func And(predicates ...predicate.MemberAuthorizeLog) predicate.MemberAuthorizeLog {
	return predicate.MemberAuthorizeLog(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.MemberAuthorizeLog) predicate.MemberAuthorizeLog {
	return predicate.MemberAuthorizeLog(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.MemberAuthorizeLog) predicate.MemberAuthorizeLog {
	return predicate.MemberAuthorizeLog(sql.NotPredicates(p))
}
